  "inlineSchema": "// This is your Prisma schema file,\n// learn more about it in the docs: https://pris.ly/d/prisma-schema\n\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"sqlite\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// User management - Gerenciamento de usuários\nmodel User {\n  id        String   @id @default(cuid())\n  email     String   @unique\n  password  String\n  name      String\n  role      String   @default(\"USER\") // ADMIN, MANAGER, USER\n  isActive  Boolean  @default(true)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations with restaurants - Relações com restaurantes\n  restaurants Restaurant[]\n\n  // Relations with financial records - Relações com registros financeiros\n  accountsPayable    AccountPayable[]\n  accountsReceivable AccountReceivable[]\n  inventoryItems     InventoryItem[]\n  purchases          Purchase[]\n  calendarEvents     CalendarEvent[]\n  payments           Payment[] // Pagamentos do cliente\n\n  @@map(\"users\")\n}\n\nmodel Restaurant {\n  id          String   @id @default(cuid())\n  name        String\n  description String?\n  address     String\n  phone       String?\n  email       String?\n  logo        String?\n  color       String?  @default(\"#d96d62\")\n  ownerId     String\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations - Relações\n  owner              User                @relation(fields: [ownerId], references: [id], onDelete: Cascade)\n  accountsPayable    AccountPayable[]\n  accountsReceivable AccountReceivable[]\n  inventoryItems     InventoryItem[]\n  purchases          Purchase[]\n  calendarEvents     CalendarEvent[]\n\n  @@map(\"restaurants\")\n}\n\n// Accounts Payable - Contas a Pagar\nmodel AccountPayable {\n  id           String    @id @default(cuid())\n  description  String\n  amount       Decimal\n  dueDate      DateTime\n  paidDate     DateTime?\n  status       String    @default(\"PENDING\") // PENDING, PAID, OVERDUE, CANCELLED\n  category     String // RENT, UTILITIES, FOOD_SUPPLIES, etc.\n  vendor       String?\n  notes        String?\n  attachments  String? // JSON string of file paths\n  userId       String\n  restaurantId String\n  createdAt    DateTime  @default(now())\n  updatedAt    DateTime  @updatedAt\n\n  // Relations - Relações\n  user       User       @relation(fields: [userId], references: [id], onDelete: Cascade)\n  restaurant Restaurant @relation(fields: [restaurantId], references: [id], onDelete: Cascade)\n\n  @@map(\"accounts_payable\")\n}\n\n// Accounts Receivable - Contas a Receber\nmodel AccountReceivable {\n  id           String    @id @default(cuid())\n  description  String\n  amount       Decimal\n  dueDate      DateTime\n  receivedDate DateTime?\n  status       String    @default(\"PENDING\") // PENDING, PAID, OVERDUE, CANCELLED\n  category     String // SALES, CATERING, DELIVERY, EVENTS, OTHER\n  customer     String?\n  notes        String?\n  attachments  String? // JSON string of file paths\n  userId       String\n  restaurantId String\n  createdAt    DateTime  @default(now())\n  updatedAt    DateTime  @updatedAt\n\n  // Relations - Relações\n  user       User       @relation(fields: [userId], references: [id], onDelete: Cascade)\n  restaurant Restaurant @relation(fields: [restaurantId], references: [id], onDelete: Cascade)\n\n  @@map(\"accounts_receivable\")\n}\n\n// Inventory Management - Gerenciamento de Inventário\nmodel InventoryItem {\n  id           String    @id @default(cuid())\n  name         String\n  description  String?\n  category     String\n  unit         String\n  quantity     Decimal\n  minQuantity  Decimal\n  maxQuantity  Decimal?\n  costPrice    Decimal\n  sellPrice    Decimal?\n  supplier     String?\n  location     String?\n  stockType    String    @default(\"RAW_MATERIAL\") // RAW_MATERIAL, FINISHED_PRODUCT, etc.\n  expiryDate   DateTime?\n  notes        String?\n  userId       String\n  restaurantId String\n  createdAt    DateTime  @default(now())\n  updatedAt    DateTime  @updatedAt\n\n  // Relations - Relações\n  user          User           @relation(fields: [userId], references: [id], onDelete: Cascade)\n  restaurant    Restaurant     @relation(fields: [restaurantId], references: [id], onDelete: Cascade)\n  purchaseItems PurchaseItem[]\n\n  @@map(\"inventory_items\")\n}\n\n// Purchase Management - Gerenciamento de Compras\nmodel Purchase {\n  id           String    @id @default(cuid())\n  orderNumber  String    @unique\n  supplier     String\n  orderDate    DateTime\n  deliveryDate DateTime?\n  status       String    @default(\"PENDING\") // PENDING, CONFIRMED, DELIVERED, CANCELLED\n  totalAmount  Decimal\n  notes        String?\n  attachments  String? // JSON string of file paths\n  userId       String\n  restaurantId String\n  createdAt    DateTime  @default(now())\n  updatedAt    DateTime  @updatedAt\n\n  // Relations - Relações\n  user       User           @relation(fields: [userId], references: [id], onDelete: Cascade)\n  restaurant Restaurant     @relation(fields: [restaurantId], references: [id], onDelete: Cascade)\n  items      PurchaseItem[]\n\n  @@map(\"purchases\")\n}\n\nmodel PurchaseItem {\n  id          String   @id @default(cuid())\n  quantity    Decimal\n  unitPrice   Decimal\n  totalPrice  Decimal\n  purchaseId  String\n  inventoryId String\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations - Relações\n  purchase  Purchase      @relation(fields: [purchaseId], references: [id], onDelete: Cascade)\n  inventory InventoryItem @relation(fields: [inventoryId], references: [id], onDelete: Cascade)\n\n  @@map(\"purchase_items\")\n}\n\n// Calendar Events - Eventos do Calendário\nmodel CalendarEvent {\n  id           String   @id @default(cuid())\n  title        String\n  description  String?\n  startDate    DateTime\n  endDate      DateTime\n  type         String // MEETING, DELIVERY, MAINTENANCE, etc.\n  priority     String   @default(\"MEDIUM\") // LOW, MEDIUM, HIGH, URGENT\n  location     String?\n  attendees    String? // JSON string of attendees\n  reminders    String? // JSON string of reminder dates\n  completed    Boolean  @default(false)\n  notes        String?\n  userId       String\n  restaurantId String\n  createdAt    DateTime @default(now())\n  updatedAt    DateTime @updatedAt\n\n  // Relations - Relações\n  user       User       @relation(fields: [userId], references: [id], onDelete: Cascade)\n  restaurant Restaurant @relation(fields: [restaurantId], references: [id], onDelete: Cascade)\n\n  @@map(\"calendar_events\")\n}\n\n// Payment Management - Controle de Pagamentos dos Clientes\nmodel Payment {\n  id             String    @id @default(cuid())\n  clientId       String // ID do cliente (usuário)\n  clientName     String // Nome do cliente\n  clientEmail    String // Email do cliente\n  amount         Decimal // Valor do pagamento\n  dueDate        DateTime // Data de vencimento\n  paidDate       DateTime? // Data do pagamento (null se não pago)\n  paymentMethod  String? // CASH, BANK_TRANSFER, PIX, etc.\n  status         String    @default(\"PENDING\") // PENDING, PAID, OVERDUE, CANCELLED\n  type           String // LICENSE, MONTHLY, SETUP, etc.\n  description    String // Descrição do pagamento\n  notes          String? // Observações\n  referenceMonth String? // Mês de referência para mensalidades\n  receiptNumber  String? // Número do recibo\n  createdAt      DateTime  @default(now())\n  updatedAt      DateTime  @updatedAt\n\n  // Relations - Relações\n  client User @relation(fields: [clientId], references: [id], onDelete: Cascade)\n\n  @@map(\"payments\")\n}\n",
